import React, { useEffect, useState } from "react";
import axios from "axios";
import "../Cards.css";
import { useParams } from "react-router-dom";

export default function Chats( props ) {
  const [ chatGroup, setChatGroup ] = useState({});
  constÂ { chatGroupId } = useParams();
  const token = sessionStorage.getItem("token");

  useEffect(() => {
    console.log(chatGroupId);
    const getChatGroupData = async () => {
      try {
        const chatGroupData = await axios.get(`http://localhost:3001/app/get-chat-group/${chatGroupId}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setChatGroup(chatGroupData.data);
      } catch (error) {
        console.log(error);
      }
    };
    getChatGroupData();
  }, [chatGroupId, token]);

  return (
    <div className="cards__container">
      <h2>{chatGroup.chatGroupName}</h2>
      <p>Chat Group ID: {chatGroup._id}</p>
    </div>
  );
}
